import React from 'react';
import './main.css';
import {Sidebar, InputItem, DropdownItem, Item } from 'react-sidebar-ui'


function Main() {
    return (
        <div className='Main'>
              <Sidebar bgColor='white' isCollapsed={false}>
              <Item bgColor='white'>Featured Auckland deals
         
          
        </Item>
              </Sidebar>
        </div>
    )
}

export default Main
